output-exprs.el:
intNextFrmVersionId:if(
	pv!intProcessIndex=0, 
	pv!CDT_MileStoneRouting[ac!intProcessIndex].FormId, 
	if(
		pv!txtButtonValue= #"_a-0000dc7e-d5cf-8000-927a-010000010000_200308"[1], 
		if(
			and(
				count(intersection({pv!CDT_MileStoneRouting[pv!intProcessIndex].ApproveFormId}, pv!arrintFrmVersionIds)) > 0,
				ac!intProcessIndex <= count(pv!arrintFormInstanceIds)
			),
			-1,
			pv!CDT_MileStoneRouting[pv!intProcessIndex].ApproveFormId
		),
		if(
			index(pv!CDT_MileStoneRouting.RejectActionMoveBack, pv!intProcessIndex, 0), 
			-1 ,
			if(
				and(
					count(intersection({pv!CDT_MileStoneRouting[pv!intProcessIndex].RejectFormId}, pv!arrintFrmVersionIds)) > 0,
					ac!intProcessIndex <= count(pv!arrintFormInstanceIds)
				),
				-1,
				pv!CDT_MileStoneRouting[pv!intProcessIndex].RejectFormId
			)
		)
	)
)
